import Axios from "axios";

function editstudentprofile(userData) {
  return dispatch => {
    console.log(userData.email);
    if (userData.type === "edit")
      return Axios.post(
        "http://127.0.0.1:4001/getStudentProfile",
        userData.email
      );
    // else if (type === "save")
    //   return Axios.post("http://127.0.0.1:4001/putStudentProfile", userData);
  };
}

